Title: The Big Bang Theory
The Big Bang Theory is an American television sitcom created by Chuck Lorre and Bill Prady, both of whom serve as executive producers on the series, along with Steven Molaro. The series premiered on CBS on September 24, 2007, and concluded on May 16, 2019, after 12 seasons. The series revolves around five characters living in Pasadena, California: Leonard Hofstadter and Sheldon Cooper, both physicists at the California Institute of Technology; Penny, a waitress and aspiring actress who later becomes a pharmaceutical sales representative;
